import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import logo from './logo.svg';
import './App.css';



function App() {
  return (
    <>
      <Routes>

      <Route path="/login" element={<LoginPage />}/>
      <Route path="*" element={ () => { <div>Other pages</div> }} />

      </Routes>
    </>
  );
}

export default App;
